about book :-

Treachery in old London, a crop circle mystery, and a cyborg punished for gazing at the night sky open this collection of new stories that will intrigue teens and adults alike. Fantasy, sci-fi, mystery, and fanciful versions of school life-the motif they share is a key. Which key will unlock a mystery, free the trapped, comfort the rejected, or bring new resolve to a boy who has taken a wrong path? What treasures can we discover if we only find the right key?


